  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112886 includes chemical,
  discrete sample, physical and profile data collected from Celtic Explorer in the
  North Atlantic Ocean from 2009-02-06 to 2012/01/10. These data include DISSOLVED
  INORGANIC CARBON (DIC), DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRATE
  + NITRITE CONTENT (CONCENTRATION), NITRITE, PHOSPHATE, SALINITY, SILICATE, TOTAL
  ALKALINITY (TA) and WATER TEMPERATURE. The instruments used to collect these data
  include Alkalinity titrator, CTD, Coulometer for DIC measurement and bottle.nnThese
  data were collected by Triona McGrath, Caroline Kivimae, Rachel R. Cave, Evin McGovern,
  Triona Dr. McGrath, Evin Dr. McGovern and Rachel R. Dr. Cave of National University
  of Ireland - Galway as part of the COASTAL_Rockall_Trough_2009_2010 and COASTAL_Rockall_Trough_2011_2012
  data set. CDIAC assigned the following cruise ID(s) to this data set: CE11001, CE12001
  and COASTAL_Rockall_Trough.nnThe Global Coastal Carbon Data Project data includes
  the bottle (discrete) and surface (underway) carbon-related measurements from coastal
  research cruises, the data from time series cruises and coastal moorings. The coastal
  regions data are very important for the understanding of carbon cycle on the continental
  margins.nnThe World Ocean Circulation Experiment (WOCE) was a major component of
  the World Climate Research Program with the overall goal of better understanding
  the ocean's role in climate and climatic changes resulting from both natural and
  anthropogenic causes. The CO2 survey took advantage of the sampling opportunities
  provided by the WOCE Hydrographic Program (WHP) cruises during this period between
  1990 and 1998. The final collection covers approximately 23,000 stations from 94
  WOCE cruises.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
